// src/App.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import CustomerLogin from './pages/CustomerLogin';
import AdminLogin from './pages/AdminLogin';
import RepresentativeLogin from './pages/RepresentativeLogin';
import Home from './pages/Home';
import AdminDashboard from './pages/AdminDashboard';
import RepresentativeDashboard from './pages/RepresentativeDashboard';
import TrainSearch from './pages/TrainSearch';
import Reservation from './pages/Reservation';
import FAQ from './pages/FAQ';

function App() {
  const role = localStorage.getItem('role'); // Get role from localStorage

  return (
    <Router>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/login" element={role ? <Home /> : <CustomerLogin />} />
        <Route path="/admin-login" element={role === 'admin' ? <AdminDashboard /> : <AdminLogin />} />
        <Route path="/representative-login" element={role === 'representative' ? <RepresentativeDashboard /> : <RepresentativeLogin />} />

        {/* Conditional routes based on role */}
        {role === 'customer' && (
          <Route path="/train-search" element={<TrainSearch />} />
        )}
        {role === 'customer' && (
          <Route path="/reservations" element={<Reservation />} />
        )}
        {role === 'customer' && (
          <Route path="/faq" element={<FAQ />} />
        )}

        {role === 'admin' && <Route path="/admin-dashboard" element={<AdminDashboard />} />}
        {role === 'representative' && <Route path="/representative-dashboard" element={<RepresentativeDashboard />} />}
      </Routes>
    </Router>
  );
}

export default App;
